import React, { useState } from 'react';
import User from "./User/User"
import Home from './Home/Home';
import Contact from './Contact';
import SignUp from './SignUp';
import Login from "./Login"

function Navbar() {
  const [activePage, setActivePage] = useState('home');

  const handlePageChange = (page) => {
    setActivePage(page);
  };

  const renderContent = () => {
    switch (activePage) {
      case 'home':
        return <div><Home /></div>;
      case 'about':
        return <div><User /></div>;
      case 'contact':
        return <div><Contact /></div>;
      case 'signup':
        return <div><SignUp /></div>;
      case 'login':
        return <div><Login /></div>;
      default:
        return null;
    }
  };

  return (
    <div>
      <div className="navbar bg-gray-300 flex justify-between items-center p-4 shadow-lg">
        <h1 className="logo text-xl font-bold">Pitch Crest</h1>
        <ul className="links flex space-x-4">
          <li><a href="#home" className="text-blue-500" onClick={() => handlePageChange('home')}>Home</a></li>
          <li><a href="#about" className="text-blue-500" onClick={() => handlePageChange('about')}>User</a></li>
          <li><a href="#contact" className="text-blue-500" onClick={() => handlePageChange('contact')}>Contact</a></li>
          <li><a href="#signup" className="text-blue-500" onClick={() => handlePageChange('signup')}>Sign up</a></li>
          <li><a href="#login" className="text-blue-500" onClick={() => handlePageChange('login')}>Login</a></li>
        </ul>
      </div>
      {renderContent()}
    </div>
  );
}

export default Navbar;
